import React from 'react';

function StoryCard({ story }) {
    return (
        <div className="card" style={{ backgroundColor: 'lightgray',height:'30px', padding: '20px', borderRadius: '10px', boxShadow: '0 4px 8px 0 rgba(0,0,0,0.2)' }}>
            <div className="card">
                <img src={`https://ik.imagekit.io/dev24/${story.Image}`} alt={story.Title} style={{ width: '100%', height: 'auto', borderRadius: '10px 10px 0 0' }} />
                <div className="card-body">
                    <h5 className="card-title">style={{ fontSize: '1.5rem', fontWeight: 'bold' }}{story.Title}</h5>
                    <p className="card-text">{story.Description}</p>
                </div>
            </div>
        </div>
    );
}

export default StoryCard;
